# @param {String} s
# @param {String} a
# @param {String} b
# @param {Integer} k
# @return {Integer[]}
def beautiful_indices(s, a, b, k)
    beautiful_indices = []
    a_indices = (0..s.length - a.length).select { |i| s[i, a.length] == a }
    b_indices = (0..s.length - b.length).select { |i| s[i, b.length] == b }

    a_indices.each do |i|
        if b_indices.any? { |j| (i - j).abs <= k }
            beautiful_indices << i
        end
    end

    beautiful_indices.sort
end
